   And User click add to Cart button\n    Then the cart icon quantity should change to '2'\n    And User click on Cart option\n    And User click on Proceed to Checkout button\n    And User click Add a new address link for shipping address\n    And User fill a new address form with below information\n      | country | fullName | PhoneNumber | StreetAddress | apt | city | state | zipCode |\n    And User click Add Your Address button\n    And User click Add a credit card or Debit Card for Payment method\n    And User fill a Debit or credit card information\n      | cardNumber | nameOnCard | expirationMonth | expirationYear | securityCode |\n    And User click on Add your card option\n    And User click on Place Your Order\n    Then message displayed 'Order Placed, Thanks'\n\n  Scenario: Verify User can place on order with Shipping address and payment Method on file\n    And User Change the category to 'Electronics'\n    And User Search for an item 'Apex Legends'\n    And User Click on Search icon\n    And User Click on item\n    And User Select quantity '5'\n    And User Click add to Cart button\n    Then The Cart icon quantity should change to '5'\n    And User Click on Cart option\n    And User Click on Proceed to Checkout button\n    And User Click on Place Your Order\n    Then a Message should be displayed 'Order Placed, Thanks'\n","mediaType":"text/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"uri":"classpath:features/Home.feature","feature":{"location":{"line":2,"column":1},"tags":[{"location":{"line":1,"column":1},"name":"@Test","id":"d24d7dba-851a-4102-9ab4-c4afdca94d1d"}],"language":"en","keyword":"Feature","name":"This feature is use for testing UI of Retail page","description":"","children":[{"scenario":{"location":{"line":4,"column":3},"tags":[],"keyword":"Scenario","name":"Verify user can search a product","description":"","steps":[{"location":{"line":5,"column":5},"keyword":"Given ","keywordType":"Context","text":"User is on retail website","id":"e032
